import React, { useState, useCallback, memo } from "react";
import { Map, GoogleApiWrapper, Marker } from "google-maps-react";
import markerImg from "m.png";

const MapContainer = props => {
	const {
		globalstate: { markers = [], index },
		updateGlobal
	} = props || {};

	const [state, _state] = useState({
		activeMarker: null
	});

	const onMarkerClick = (pp, activeMarker, index) => {
		updateGlobal("index", index);

		activeMarker.animation = pp.google.maps.Animation.BOUNCE;
		activeMarker.animating = true;
		console.log("pp, activeMarker,", pp, activeMarker);

		_state({
			activeMarker
		});
	};

	const onMapClicked = props => {
		_state(e => ({
			...e,
			index: undefined,
			activeMarker: null
		}));
	};

	const DisplayMarkers = memo(({ markers, google, onMarkerClick }) => {
		return markers.map((m, mx) => (
			<Marker
				key={mx}
				labelClass="labelc"
				onClick={(pp, mr) => onMarkerClick(pp, mr, mx)}
				animation={google.maps.Animation.DROP}
				icon={{
					url: markerImg,
					scaledSize: new google.maps.Size(defsize, defsize)
				}}
				{...m}
			/>
		));
	});

	return (
		<Map
			{...props}
			zoom={6.5}
			style={{
				width: "100%",
				height: "100%"
			}}
			styles={styles}
			initialCenter={{ lat: 49.037868, lng: 31.904297 }}
			onClick={onMapClicked}>
			{/* <DisplayMarkers
				markers={markers}
				onMarkerClick={onMarkerClick}
				google={google}
			/> */}
			{DisplayMarkers({ markers, onMarkerClick, google })}
		</Map>
	);
};

const defsize = 25;

const styles = [
	{
		featureType: "water",
		elementType: "geometry",
		stylers: [
			{
				color: "#cccccc"
			},
			{
				lightness: 17
			}
		]
	},
	{
		featureType: "landscape",
		elementType: "geometry",
		stylers: [
			{
				color: "#f5f5f5"
			},
			{
				lightness: 20
			}
		]
	},
	{
		featureType: "road.highway",
		elementType: "geometry.fill",
		stylers: [
			{
				color: "#ffffff"
			},
			{
				lightness: 17
			}
		]
	},
	{
		featureType: "road.highway",
		elementType: "geometry.stroke",
		stylers: [
			{
				color: "#ffffff"
			},
			{
				lightness: 29
			},
			{
				weight: 0.2
			}
		]
	},
	{
		featureType: "road.arterial",
		elementType: "geometry",
		stylers: [
			{
				color: "#ffffff"
			},
			{
				lightness: 18
			}
		]
	},
	{
		featureType: "road.local",
		elementType: "geometry",
		stylers: [
			{
				color: "#ffffff"
			},
